import Main from './pages/Main';
import { Navigate, useLocation } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'


import { Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (

    <>
    <Routes>
        <Route path="/main" element={<Main/>}>

        </Route>
    </Routes>
    </>

  );
}


export default App;
